import React from 'react';
import { Navbar, Nav, Container } from "react-bootstrap";
import { BrowserRouter as Router, Route, Switch, Link } from 'react-router-dom';

import Home from './pages/site/home.site';
import Ministry from './pages/site/ministry.site';

import Admin from './pages/admin/admin';
import AdminLogin from './pages/admin/login.admin';

import Footer from "./components/footer.component";
import Logo from "./assets/img/lighthouse_logo_3.png";
import HOME from "./assets/img/home.svg";
import BIBLE from "./assets/img/bible.svg";

import "./assets/css/navbar.scss";

function App() {
  return (
    <Router>
        <Navbar className="navbar-float-above">
          <Navbar.Brand href="/">
            <div width="70" height="70">
              <img src={Logo} height="70" alt="lighthouse logo"/>
            </div>
          </Navbar.Brand>
        </Navbar>
        <Nav className="flex-column menu-float-left">
          <Nav.Link href="/"><img id="menu-logo" src={HOME}/></Nav.Link>
          <Nav.Link href="/ministry"><img className="menu-logo" src={BIBLE}/></Nav.Link>
          {/* <Nav.Link href="#"><text>DONATE</text></Nav.Link> */}
        </Nav>

        <Switch>
          <Route exact path="/" component={Home}/>
          <Route path="/ministry" component={Ministry} />

          <Route path="/admin/login" component={AdminLogin} />
          <Route path="/admin" component={Admin} />
        </Switch>
        <Footer></Footer>
    </Router>
  );
}

export default App;
